    "name": "FAA Obstructions",
    "description": "This dataset contains the locations of Federal Aviation Administration known obstructions. The Digital Obstacle File (DOF) is a listing of verified and unverified obstacles in the U.S. with limited coverage of the Pacific, the Caribbean, Canada, Mexico, and the Bahamas. The obstacles are assigned unique alphanumerical identifiers and are listed in order by ascending latitude within each state or country. The Digital Obstacle File, from which this layer was created, contains only obstruction data for those man-made objects which affect domestic aeronautical charting products and does not purport to indicate the presence of all obstructions which may be encountered. PLEASE NOTE: In the interest of air safety, the Digital Obstacle File depicts both \"verified\" and \"unverified\" obstruction data. A verified obstruction is indicated by an \"O\" in the Verification Status field. This data has either been reviewed by the FAA's Aeronautical Information Services (AIS), Obstacle Data Team (ODT) or has been taken from airport survey data. Verified obstacles have been assigned an accuracy code, indicating the reliability of its vertical height and horizontal position. An unverified obstruction is indicated by a \"U\" in the Verification Status field. This data is considered unreliable because its position and height have not been verified by the ODT.",
