    "description": "This dataset contains a statewide polygon layer identifying the Waterbody Identification Units (WBIDs) on the Strategic Monitoring Plan that the department has scheduled to be monitored to determine whether waterbodies and waterbody segments are attaining the minimum criteria for surface waters established in the Surface Water Quality Standards (Chapter 62-302, F.A.C.) and the Identification of Impaired Surface Waters (Chapter 62-303, F.A.C.). The WBIDs or assessment units are drainage basins, lakes, lake drainage areas, springs, rivers and streams, segments of rivers and streams, coastal, bay and estuarine waters in Florida. Monitoring efforts have been prioritized in specific basins to allow there to be a focus on collecting data where there may be shortfalls, and to combine with critical ongoing sampling needed for assessment. Following data collection, sample results are uploaded to Watershed Information Network (WIN) or the state biological database (SBIO). Waterbodies assessed as impaired are placed on the Verified List of Impaired Waters and are prioritized for a TMDL (Total Maximum Daily Load) to be developed to determine the maximum amount of a pollutant that a waterbody can receive and attain water quality standards. For more information or questions regarding waterbodies identified on the Strategic Monitoring Plan, please contact Kevin O'Donnell (kevin.odonnell@dep.state.fl.us or (850) 245-8469). This is an update to the FGDL layer WBIDS_SMP_JUL18.",
