    "description": "This dataset contains Waters Not Attaining Standards (WNAS) in the State of Florida. Waters of the state of Florida are broken up into 5 groups that are assessed on a rotating basis (generally one group per year). This coverage is a compilation of the last five groups of assessments (Group 2, Cycle 3 through Group 1, Cycle 4) and includes any WBID/parameter combination that did not attain standards (assessment categories 4a, 4b, 4d, 4e, and 5). If a WBID (waterbody) does not attain standards for multiple parameters, overlapping polygons are created to represent each parameter. So that the assessment units (WBIDs) properly reflect their status at the time of assessment, the geometry for this layer is based on the run at the time the assessment for each group was made (Group 1 - Run 56; Group 2 - Run 50; Group 3 - Run 52; Group 4 Run 53; Group 5 Run 54). For more information or questions regarding the waters not attaining standards, please contact Kevin O'Donnell (kevin.odonnell@dep.state.fl.us or (850) 245-8469) or for questions specific to this layer, please contact Phil Homann (philip.homann@dep.state.fl.us or (850) 245-8472). This is an update to the FGDL layer WATERS_NOT_STND_AUG18.",
