    "name": "FDEP (WIN) Monitoring Locations",
    "description": "This dataset contains all monitoring locations that have been processed through the Watershed Information Network (WIN) applications in the State of Florida. WIN is the DEP repository for reporting and managing environmental quality data from non-regulatory databases or data sources from a range of data providers across the State of Florida. WIN replaces Florida STORET as an active data repository. WIN data, together with Florida STORET data, are used for a range of purposes, including but not limited to Impaired Waters Rule assessments, development of Total Maximum Daily Loads, Basin Management Action Plans, Strategic Monitoring Plans, and criteria development, including Site Specific Alternative Criteria (SSAC). Data providers to WIN and users of those data include federal, DEP and other state agencies, local agencies, academic institutions, volunteer organizations, private laboratories, and others. Monitoring locations must pass all WIN Minimum Data Quality Standards (MDQS), be individually visually verified by the organization that loaded the locations, and be associated to a NHD Reach Code, when required. Reach codes are required for all types of monitoring locations except for Oceans, Wetlands, Spring Boils, Spring Vents, and Ground Water types. This is an update to the FGDL layer WIN_MONITOR_LOC_JUN19.",
