    "description": "This feature class contains the boundaries for the Northern Everglades, Southern Everglades, and the protection plans for the Lake Okeechobee (LOPP), Caloosahatchee River Watershed (CRWPP), and St. Lucie River Watershed (SLRWPP). The feature class has a field named \"Type\"; corresponding to the following values:0 = set for the boundaries comprising the Northern and Southern Everglades; 1 = set for the overlap between the two areas North and South; 2 = set for Northern Everglades and Estuaries Protection Program (NEEPP); 3 = set for watersheds; 4 = set for subwatersheds; 5 = set for drainage basins; 6 = set for the Lake Okeechobee (waterbody). The boundary for the Northern Everglades and Estuaries Protection Program (NEEPP) is defined as the combined area for the Lake Okeechobee, Caloosahatchee River, and St. Lucie River watersheds. These boundaries were defined over time from varying versions of the SFWMD ArcHydo-Enhanced-Dataset (AHED) and other supplemental data and were last updated in 2014.",
