    "name": "Unified Reef Map",
    "description": "The Unified Reef Map is a regional map of benthic habitats that occur throughout the Florida reef tract. The Unified Reef Map consists of individual maps and monitoring data provided by our numerous partners. The purpose of the Unified Reef Map is to provide a comprehensive view of habitats from Martin County through the Florida Keys to the Dry Tortugas. The Unified Reef Map supports the larger effort to coordinate scientific research and promote a reef-wide approach for protecting Floridas reef tract. To create the URM, individual maps are integrated, data are edited where overlapping or neighboring maps disagree, and habitat classes are cross-walked to allow comparisons between maps. The URM symbolizes benthic habitats, or bottom types, using the Unified Classification (UC) system. The UC framework allows translation between different classification schemes while retaining the original detailed information provided by our mapping partners. There are five hierarchical UC classes starting at UC Level 0 which represents broad habitat classes and can be consistently translated between individual maps. At the most detailed UC Level 4, benthic habitats are described differently between map providers and may differ throughout the Unified Reef Map. The UC system is also cross-walked to the Coastal and Marine Ecological Classification Standard (CMECS). Un-edited source maps provided by URM map partners are also available. The Unified Reef Map is a living map and will be updated as new data become available. Version 2.0 released January 2017. For more information visit: http://ocean.floridamarine.org/IntegratedReefMap/UnifiedReefTract.htm",
