    "name": "Sea Turtle Strandings",
    "description": "This dataset contains Florida Sea Turtle Stranding and Salvage Network (STSSN) data for the years 1986-2017. The STSSN is responsible for gathering standardized data on stranded marine turtles throughout the state this effort is coordinated by the Florida Fish and Wildlife Conservation Commission - Fish and Wildlife Research Institute (FWRI). The Florida STSSN functions as a part of an eighteen state network led by NOAA's National Marine Fisheries Service (NMFS). In Florida, strandings are documented by FWRI staff biologists and by a network of permitted participants located around the state. Live strandings are rescued and transported to properly permitted rehabilitation facilities. Data from strandings are collected on a standardized reporting form and include date, species, location, carapace length and width, carcass condition, carcass disposition, and information on anomalies (e.g., entanglement, propeller damage, fibropapillomas). Additionally, certain carcasses are regularly collected by FWRI staff for gross or detailed necropsy. Each week, FWRI reports Florida strandings to NMFS as a part of a management plan that is intended to reduce the incidental take of turtles in the shrimp fishery. FWRI also generates monthly and yearly stranding summary reports to monitor mortality and to detect and describe any unusual stranding events. Stranding data collected through the Florida STSSN have been used extensively in the identification of mortality factors and in the development of recovery actions (e.g., Turtle Excluder Device (TED) requirements, gill net regulations).",
