    "id": 9102037,
    "url": "https://carto.nationalmap.gov/arcgis/rest/services/structures/MapServer/37",
    "name": "Campgrounds",
    "description": "Schools, Fire Stations and Hospitals\nThe schools within this dataset are composed of Public elementary and secondary education in the US as defined and tracked by the National Center for Education Statistics (NCES), Common Core Dataset (CCD). Private schools in this dataset are composed of Private elementary and secondary education in the US as defined by the Private School Survey, NCES. The colleges and Universities are composed of postsecondary education facilities as defined by the Integrated Post Secondary Education System (IPEDS), NCES. Included are Doctoral and Research Universities, Masters Colleges and Universities, Baccalaureate Colleges, Associates Colleges, Theological seminaries, Medical schools and other health care professions, schools of engineering and technology, business and management, art, music, design, Law schools, Teachers colleges, Tribal colleges and other specialized institutions.\nThe schools within this dataset are composed of Public elementary and secondary education in the US as defined and tracked by the National Center for Education Statistics (NCES), Common Core Dataset (CCD). Private schools in this dataset are composed of Private elementary and secondary education in the US as defined by the Private School Survey, NCES. The colleges and Universities are composed of postsecondary education facilities as defined by the Integrated Post Secondary Education System (IPEDS), NCES. Included are Doctoral and Research Universities, Masters Colleges and Universities, Baccalaureate Colleges, Associates Colleges, Theological seminaries, Medical schools and other health care professions, schools of engineering and technology, business and management, art, music, design, Law schools, Teachers colleges, Tribal colleges and other specialized institutions.\nAny location where fire fighters are stationed or based out of, or where equipment that such personnel use in carrying out their jobs is stored for ready use. Fire fighting training academies or locations are included. Fire Departments which are Mobile Units and not having a permanent location, are included, in which case their location has been depicted at the city/town hall or at the center of their service area if a city/town hall does not exist. This dataset includes those locations primarily engaged in forest or grasslands fire fighting, including fire lookout towers if the towers are in current use for fire protection purposes.  This dataset includes both private and governmental entities.  Locations that serve only administrative function are excluded. Locations serving both administrative and operational functions are included.\nIncludes general medical and surgical hospitals, psychiatric, substance abuse and specialty hospitals such as Children's hospitals, cancer, maternity and rehabilitation hospitals. Other types of hospitals are included if represented in data sets provided by various partners for this compilation. Hospitals operated by the US Department of Veterans Affairs are included. Nursing homes, long term care facilities and Urgent Care facilities are generally excluded. Locations that are administrative offices only are excluded from the dataset.",
